import React from 'react';
import { View } from 'react-native';
import colors from '../styles/colors'

function Divider () {

  return (
    <View style={styles.divider}>
    </View>
  );


const styles = StyleSheet.create({
  divider: {
    height: 1,
    width: '80%',
    backgroundColor: '#DFE2E2',
    alignSelf: 'center'
  },
});

}

export default Divider;
